import React from "react";
import VideoItem from "./VideoItem";

const VideosList = (props) => {
    const videos = props.videos.map((video) => {
        return <VideoItem video = {video}/>
    })

    return (
    <div>
        {videos}
    </div>);
}

export default VideosList;
